import { Link } from 'react-router-dom';

const CharacterDetail = (props) => {
  if (props.character === undefined) {
    return (
      <div className="modal">
        <div className="modal__dialog">
          <div className="modal__content">
            <header className="modal__header">
              <h2 className="modal__title">
                Usuario no encontrado <i class="fa-solid fa-circle-xmark"></i>
              </h2>
              <Link to="/">
                <span className="modal__close icon fas fa-times"></span>
              </Link>
            </header>
            <section>
              <p>BÃºscate la vida</p>
            </section>
          </div>
        </div>
      </div>
    );
  } else {
    return (
      <>
        <header className="modal__header">
          <h2>titulo</h2>
          <Link to="/">
            Volver al listado
            <span className="modal__close icon fas fa-times"></span>
          </Link>
        </header>
        <section>
          <img
            className="card__img"
            src={props.character.image}
            alt={`Foto de ${props.character.name}`}
            title={`Foto de ${props.character.name}`}
          />
          <ul className="">
            <li key={props.character.id}>{props.character.name}</li>
            <li>{props.character.alive}</li>
            <li>{props.character.species}</li>
            <li>{props.character.gender}</li>
            <li>{props.character.house}</li>
          </ul>
        </section>
      </>
    );
  }
};
export default CharacterDetail;
